INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, 'Our customers are the most important part of our business, they are not dependent on us, but rather we are dependent on them.  Our customers are not an interruption of our work,  they are the purpose of it.  Our customers are not outsiders in our business,  but are a major part of it.  We are not doing our customers a favor by serving them.  Our customers are doing us a favor by allowing us the opportunity to serve them\r\n', 'About Us/Mission Statement', 'filtered_html'),
(2, '<div id="connect-with">\r\n  <p id="connect-text">CONNECT</p>\r\n  <p id="with-text">WITH S.C.O.A</p>\r\n  <ul>\r\n    <li><a id="connect-with-f-link" href="#"><img src="/sites/all/themes/professional_theme/images/facebook-icon.png" /></a></li>\r\n    <li><a id="connect-with-t-link" href="https://twitter.com/goskoot"><img src="/sites/all/themes/professional_theme/images/twitter-icon.png" /></a></li>\r\n    <li><a id="connect-with-g-link" href="#"><img src="/sites/all/themes/professional_theme/images/google-icon.png" /></a></li>\r\n  </ul>\r\n</div>', 'CONNECT WITH S.C.O.A', 'full_html'),
(3, '<div id="footer-content">\r\n  <ul>\r\n    <li id="twitter-feed">\r\n      <span class="footer-title">TWITTER FEED</span>\r\n      <ul>\r\n        <li>\r\n          <p>hey@cazoobi just been using WebZap, its pretty cool and a real time saver :)</p>\r\n          <p>1 day ago</p>\r\n        </li>\r\n        <li>\r\n          <p>hey@uipardes''s awesome web developer plugin for Photoshop check it out. webzap, uiparade.com</p>\r\n          <p>2 day ago</p>\r\n        </li>\r\n      </ul>\r\n    </li>\r\n    <li id="company-info">\r\n      <div><span class="footer-title">COMPANY INFO</span></div>\r\n      <ul>\r\n        <li class="company-info-item"><a href="/content/company-info">ABOUT US</a></li>\r\n        <li class="company-info-item"><a href="/content/team">TEAM</a></li>\r\n        <li class="company-info-item"><a href="/employment">CAREER OPPORTUNITIES</a></li>\r\n        <li class="company-info-item"><a href="/content/contact-us">CONTACT US</a></li>\r\n      </ul>\r\n      <ul>\r\n        <li class="company-info-item"><a href="/content/our-people">OUR PEOPLE</a></li>\r\n        <li class="company-info-item"><a href="/content/our-brands">OUR BRAND</a></li>\r\n        <li class="company-info-item"><a href="/content/our-locations">OUR LOCATIONS</a></li>\r\n        <li class="company-info-item"><a href="#">TERMS OF USE</a></li>\r\n        <li class="company-info-item"><a href="#">PRIVACY</a></li>\r\n      </ul>\r\n    </li>\r\n  <li id="footer-logo">\r\n    <a href="#"></a>\r\n  </li>\r\n  </ul>\r\n  <div id="copy-right">&copy; Copyright Shuttle Company of America LLC. 2013. All Rights Reserved | design by: <a href="http://ezduzit.ca">ezduzit.ca</a></div>\r\n</div>', 'Footer Block', 'full_html'),
(4, '<div id="news-letter-signup-form">\r\n  <div id="nlform-title">SIGN UP FOR THE LATEST</div>\r\n  <div id="nlform-slogan">NEWS, DEALS & SPECIALS!</div>\r\n  <div id="nlform-input">\r\n    <input id="youremail" type="text" value="" />\r\n    <button id="signup_btn">SIGN UP</button>\r\n  </div>\r\n</div>', 'News Letter Sign Up Form', 'full_html'),
(5, '<p class="ad-title">OUR BRANDS</p>\r\n<p class="ad-content">Proin gravida nibh vel velit auctor aliquet. Aenean sollicitudin, lorem quis bibendum auctor, nisi elit consequat ipsum, nec sagittis sem nibh id elit. </p>', 'OUR BRANDS', 'full_html'),
(6, '<p class="ad-title">OUR PEOPLE</p>\r\n<p class="ad-content">SCOA operated airport shuttle service believes in employing highly skilled, trained, friendly staff, from drivers to phone agents.  We pride ourselves in satisfying our customers while focusing on your safety.</p>', 'OUR PEOPLE', 'full_html'),
(7, '<p class="ad-title">OUR LOCATIONS</p>\r\n<p class="ad-content">Roadrunner Shuttle by SCOA is operated out of PHX and AZA airport.</p>', 'OUR LOCATIONS', 'full_html');
