INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 2, 2, 'und', 0, '<div id="company-info">\r\n  <img src="/sites/all/themes/professional_theme/images/company-info.png" />\r\n  <div>\r\n<DIV>\r\n <p class="article-title">SCOA HISTORY</p>\r\n    <p class="article-info">SCOA is a relatively new company with over 30 years of combined experience in the airport shuttle business at the top. As SCOA continued to grow, the company has moved their operations to Henderson NV. Nevada was selected based on its strategic geographic location for traveler’s, destination market features, skilled workers with hospitality / customer service experience and the tax relief for Nevada-based businesses.  \r\n</p>\r\n  </div>\r\n    <p class="article-title">OUR COMPANY</p>\r\n    <p class="article-info">In the wake of customers deserving more conveniences and less fuss while traveling, SCOA has come up with a simple solution, treat our customers like family. To have a successful organization is to be opportunity-focused with customer satisfaction. So we''ve taken our family of employee drivers, which we believe are our most valued resource and enlisted them to care and treat all passengers like family with dignity and respect, while providing the exceptional service our customers deserve.\r\n\r\nOur highly trained drivers work hard every day at being the best they can be to provide the most enjoyable airport shuttle transportation.  Our strategy is to capitalize on our brand with online audiences, phone apps and the assistance of our call center agents for our business growth in preferred select markets.\r\n\r\nSCOA wishes to work with in an effort to expand, grow territories and enhance our current business. This program contains a strong value proposition which is mutually beneficial for both SCOA and our customers.  \r\n</p>\r\n  </div>\r\n  <div>\r\n    <p class="article-title">OUR VISON</p>\r\n    <p class="article-info">SCOA will continue to expand and provide the best airport shuttle services through technology and outstanding customer support.  With a commitment to company growth, the addition of more airport shuttle options for consumers and an increasing audience, SCOA will maintain a supportive work environment focused on the values of family and community commitment. SCOA will also invest in media and advertising as well as handle operational elements and reservation systems.  Through this exposure, we hope to see a significant increase in customers and reservation volume.\r\n\r\nIn the interest of establishing a recognized, national brand and providing customers with the same level of services they can expect when visiting multiple cities. SCOA will also work with market partners to launch our brand name exclusive to no others.  \r\n\r\nIt is important to note that each city site will leverage the national brand name and utilize the national reservations system.  Each city site will be responsible for staffing and day-to-day operations with support in advertising, IT and additional operations management resources.\r\n\r\nThis strategic relationship is designed to grow our business using proprietary metrics in determining pricing and service areas, improved operational efficiency through state-of-the-art reservation, dispatch and on-van technology systems.  Increased revenue will be realized through both online and traditional marketing, strategic travel partners and incredible call center services for each and every driver, yielding customer referrals and retention.\r\n</p>\r\n    <div class="clear"></div>\r\n  </div>\r\n  <div>\r\n    <p class="article-title">OUR SERVICE & VEHICLES</p>\r\n    <p class="article-info">SCOA is a door to door airport transportation company providing rides to and from the airport. Under the guidance of state regulation and certification through the US-DOT and FMCSA, all of our shuttle drivers are fully licensed and continually trained to offer the safest and most courteous trip possible. The company provides an easy-to-use website, cell phone app, and a toll free customer service center for travelers to receive price quotes and instantly book reservations for shared ride van services.  \r\n\r\nPrimary transportation options available on SCOA include:\r\n•	Shared Ride Vans\r\n•	Private Shuttle Vans\r\n•	Inner-Airport and Terminal-to-Terminal Shuttle Services\r\n\r\nPrimary vehicle options available through SCOA include:\r\n•	2012-13 Ford Escape (up to 4 passengers)\r\n•	2014 Ford Transit Connect (up to 6 passengers)\r\n•	2012-13 Mercedes Benz Sprinter 144 (up to 9 passengers)\r\n•	2012-13 Mercedes Benz Sprinter 170 (up to 13 passengers)\r\n </p>\r\n  </div>\r\n</div>', '', 'full_html'),
('node', 'page', 0, 19, 19, 'und', 0, 'Summary of SCOA core operational staff, drivers, customer service agents and dispatchers and management.', '', 'filtered_html'),
('node', 'page', 0, 20, 20, 'und', 0, 'Currently, Shuttle Company of America, owns and operates the Roadrunner Shuttle branded shared ride transportation service out of PHX and AZA airport.  ', '', 'filtered_html'),
('node', 'page', 0, 21, 21, 'und', 0, 'Southern California\r\nLos Angeles, CA (LAX)\r\nBurbank, CA (BUR)\r\nSanta Barbara, CA (SBA)\r\n\r\nPhoenix\r\nPhoenix Sky Harbor, AZ (PHX)\r\nMesa-Gateway, AZ (AZA)\r\n\r\nNevada\r\nLas Vegas, NV (LAS) (coming soon)\r\n', '', 'full_html'),
