('node', 'webform', 0, 28, 28, 'und', 0, '<p>Shuttle Company of America, LLC\r\n2275 Corporate Circle\r\nSuite 275\r\nHenderson, NV 89074\r\nPhone (702) 659-8829\r\nFax (702) 659-8829\r\nEmail  contact@shuttlecompanyofamerica.com </p>\r\n\r\n<p>Partnerships  partners@shuttlecompanyofamerica.com\r\nVendors vendors@shuttlecompanyofamerica.com\r\n<a href="/content/feedback">Visit Our Feedback Page</a></p>', '', 'filtered_html'),
('node', 'webform', 0, 30, 30, 'und', 0, 'How was your Shuttle Experience?\r\n\r\nYour feedback is greatly appreciated and welcome anytime.  We want to hear about your experience in using our service.  Please contact our customer service with your comments, feedback or general questions by filling out our feedback form below.\r\n\r\n', '', 'filtered_html');
INSERT INTO `field_data_field_job_description` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `field_job_description_value`, `field_job_description_summary`, `field_job_description_format`) VALUES
('node', 'job', 0, 27, 27, 'und', 0, 'SHIFTS AVAILABLE:\r\nAll shifts/days available.\r\n\r\nLooking for full-time drivers.\r\n\r\nRATE OF PAY:\r\nNo passenger endorsement: $8 per hour plus gratuities\r\nWith passenger endorsement: $9 per hour plus gratuities\r\n\r\nPRE-EMPLOYMENT REQUIREMENTS: \r\n10-year MVD printout: no more than 2-points and must be less than 10-days old \r\nAge 25 or older (Insurance requirement)\r\nApproval from Roadrunner''s vehicle insurance carrier \r\nMinimum 1-year driving for hire experience (Can be any driving for hire experience such as delivery. Does not need to be with passengers)\r\nBackground screening \r\nPre-employment drug screening\r\nPre-employment physical \r\n\r\nOTHER REQUIREMENTS: \r\nStrong customer service skills \r\nMust speak fluent English \r\nDriver attire: Black slacks, white shirt, black tie and black shoes \r\nDefensive driving skills \r\nReliable \r\nAble to lift 60 to 80 pounds luggage\r\nShould be comfortable using electronic equipment (will be trained).\r\nNon-Smoker preferred \r\nUpon hire, the person chosen will need to show proof of eligibility to work in the United States. \r\n\r\nPlease call Lori at 805-389-8196 ext. 234 for an application packet.\r\n\r\nYou may also request the application packet via email: lori@rrshuttle.com\r\n\r\nThank you for considering Roadrunner Shuttle & Limousine as your choice of employment. We are an Equal Employment Opportunity Employer.\r\nLocation: PHOENIX\r\nCompensation: $8 to $9 per hour plus gratuities\r\nPrincipals only. Recruiters, please don''t contact this job poster.\r\nPhone calls about this job are ok.\r\nPlease do not contact job poster about other services, products or commercial interests.\r\n', '', 'filtered_html');
