(2, 'node', ' company info scoa history scoa is a relatively new company with over 30 years of combined experience in the airport shuttle business at the top as scoa continued to grow the company has moved their operations to henderson nv nevada was selected based on its strategic geographic location for traveler s destination market features skilled workers with hospitality customer service experience and the tax relief for nevadabased businesses our company in the wake of customers deserving more conveniences and less fuss while traveling scoa has come up with a simple solution treat our customers like family to have a successful organization is to be opportunityfocused with customer satisfaction so we ve taken our family of employee drivers which we believe are our most valued resource and enlisted them to care and treat all passengers like family with dignity and respect while providing the exceptional service our customers deserve our highly trained drivers work hard every day at being the best they can be to provide the most enjoyable airport shuttle transportation our strategy is to capitalize on our brand with online audiences phone apps and the assistance of our call center agents for our business growth in preferred select markets scoa wishes to work with in an effort to expand grow territories and enhance our current business this program contains a strong value proposition which is mutually beneficial for both scoa and our customers our vison scoa will continue to expand and provide the best airport shuttle services through technology and outstanding customer support with a commitment to company growth the addition of more airport shuttle options for consumers and an increasing audience scoa will maintain a supportive work environment focused on the values of family and community commitment scoa will also invest in media and advertising as well as handle operational elements and reservation systems through this exposure we hope to see a significant increase in customers and reservation volume in the interest of establishing a recognized national brand and providing customers with the same level of services they can expect when visiting multiple cities scoa will also work with market partners to launch our brand name exclusive to no others it is important to note that each city site will leverage the national brand name and utilize the national reservations system each city site will be responsible for staffing and daytoday operations with support in advertising it and additional operations management resources this strategic relationship is designed to grow our business using proprietary metrics in determining pricing and service areas improved operational efficiency through stateoftheart reservation dispatch and onvan technology systems increased revenue will be realized through both online and traditional marketing strategic travel partners and incredible call center services for each and every driver yielding customer referrals and retention our service vehicles scoa is a door to door airport transportation company providing rides to and from the airport under the guidance of state regulation and certification through the usdot and fmcsa all of our shuttle drivers are fully licensed and continually trained to offer the safest and most courteous trip possible the company provides an easytouse website cell phone app and a toll free customer service center for travelers to receive price quotes and instantly book reservations for shared ride van services primary transportation options available on scoa include shared ride vans private shuttle vans innerairport and terminaltoterminal shuttle services primary vehicle options available through scoa include 201213 ford escape up to 4 passengers 2014 ford transit connect up to 6 passengers 201213 mercedes benz sprinter 144 up to 9 passengers 201213 mercedes benz sprinter 170 up to 13 passengers  ', 0),
