(27, 'node', ' drivers needed phoenix  shifts available all shifts days available looking for fulltime drivers rate of pay no passenger endorsement 8 per hour plus gratuities with passenger endorsement 9 per hour plus gratuities preemployment requirements 10year mvd printout no more than 2points and must be less than 10days old age 25 or older insurance requirement approval from roadrunner s vehicle insurance carrier minimum 1year driving for hire experience can be any driving for hire experience such as delivery does not need to be with passengers background screening preemployment drug screening preemployment physical other requirements strong customer service skills must speak fluent english driver attire black slacks white shirt black tie and black shoes defensive driving skills reliable able to lift 60 to 80 pounds luggage should be comfortable using electronic equipment will be trained nonsmoker preferred upon hire the person chosen will need to show proof of eligibility to work in the united states please call lori at 8053898196 ext 234 for an application packet you may also request the application packet via email  lori rrshuttlecom thank you for considering roadrunner shuttle limousine as your choice of employment we are an equal employment opportunity employer location phoenix compensation 8 to 9 per hour plus gratuities principals only recruiters please don t contact this job poster phone calls about this job are ok please do not contact job poster about other services products or commercial interests fulltime ', 0),
